import{_ as a,a as t,b as l,c as r,d as e,e as o,f as s,g as n,h,i as p,j as d,k as c,l as m,m as u,n as P,o as k,p as g,q as b,r as x,s as _,t as f}from"./chunks/pixhawk_mini_port_main_out.D5Z6b-VK.js";import{_ as i}from"./chunks/3dr_anti_vibration_mounting_foam.D_h4u7yq.js";import{_ as M,c as S,o as w,ab as q}from"./chunks/framework.CUflZczI.js";const y=JSON.parse('{"title":"Holybro Pixhawk Mini (Припинено)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/pixhawk_mini.md","filePath":"uk/flight_controller/pixhawk_mini.md"}'),C={name:"uk/flight_controller/pixhawk_mini.md"},v=q('<h1 id="holybro-pixhawk-mini-припинено" tabindex="-1">Holybro Pixhawk Mini (Припинено) <a class="header-anchor" href="#holybro-pixhawk-mini-припинено" aria-label="Permalink to &quot;Holybro Pixhawk Mini (Припинено)&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">PX4 не виробляє цей (або будь-який інший) автопілот. Звертайтесь до <a href="https://holybro.com/" target="_blank" rel="noreferrer">виробника</a> щодо питань апаратного забезпечення або питань відповідності. :::</p><p>Автопілот Holybro <em>Pixhawk<sup>®</sup> Mini</em> - це наступне покоління еволюції Pixhawk. Це близько 1/3 розміру оригінального Pixhawk та має потужніші процесори та сенсори.</p><p>Pixhawk Mini базується на відкритому проекті PX4 і був оптимізований для стеку керування польотом PX4.</p><p><img src="'+a+'" alt="Pixhawk Mini"></p><p>Інформація щодо підключення доступна <a href="#wiring">нижче</a>.</p><div class="info custom-block"><p class="custom-block-title">Цей контролер польоту був розроблений компанією 3DR у співпраці з HobbyKing<sup>®</sup>. Раніше він був відомий як 3DR Pixhawk Mini. :::</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Цей автопілот <a href="./../flight_controller/autopilot_pixhawk_standard.html">підтримується</a> командами підтримки та тестування PX4. :::</p><h2 id="специфікаціі" tabindex="-1">Специфікації <a class="header-anchor" href="#специфікаціі" aria-label="Permalink to &quot;Специфікації&quot;">​</a></h2><p><strong>Процесори:</strong></p><ul><li><strong>Основний процесор:</strong> STM32F427 Rev 3</li><li><strong>IO процесор:</strong> STM32F103</li></ul><p><strong>Сенсори:</strong></p><ul><li><strong>Accel/Gyro/Mag:</strong> MPU9250 <ul><li><a href="https://github.com/PX4/PX4-Autopilot/pull/7618" target="_blank" rel="noreferrer">застарілий</a> для прошивки PX4</li></ul></li><li><strong>Accel/Gyro:</strong> ICM20608</li><li><strong>Barometer:</strong> MS5611</li></ul><p><strong>Номінальна напруга:</strong></p><ul><li><strong>Вивід модуля живлення:</strong> 4.1~5.5V</li><li><strong>Максимальна вхідна напруга:</strong> 45V (10S LiPo)</li><li><strong>Максимальне вимірювання струму:</strong> 90A</li><li><strong>Вхід живлення USB:</strong> 4.1`5.5V</li><li><strong>Вхід Servo Rail:</strong> 0~10V</li></ul><p><strong>Інтерфейси:</strong></p><ul><li>1 x UART Serial Port (для GPS)</li><li>Spektrum DSM/DSM2/DSM-X® Satellite Compatible RC вхід</li><li>Futaba S BUS® Compatible RC вхід</li><li>PPM Sum Signal RC вхід</li><li>I2C (для цифрових сенсорів)</li><li>CAN (для цифрового керування мотором з сумісними контролерами)</li><li>ADC (для аналогових сенсорів)</li><li>Мікро USB порт</li></ul><p><strong>Вага та розміри:</strong></p><ul><li><strong>Розміри:</strong> 38x43x12мм</li><li><strong>Вага:</strong> 15.8g</li></ul><p><strong>Модуль GPS (постачається з комплектом):</strong></p><ul><li><strong>GNSS приймач:</strong> u-blox<sup>®</sup> Neo-M8N; компас HMC5983</li><li><strong>Вага:</strong> 22.4g</li><li><strong>Розміри:</strong> 37x37x12мм</li></ul><h2 id="де-придбати" tabindex="-1">Де придбати <a class="header-anchor" href="#де-придбати" aria-label="Permalink to &quot;Де придбати&quot;">​</a></h2><p>Припинено.</p><h2 id="призначення-конекторів" tabindex="-1">Призначення конекторів <a class="header-anchor" href="#призначення-конекторів" aria-label="Permalink to &quot;Призначення конекторів&quot;">​</a></h2><p><code>&lt;To be added&gt;</code></p><h2 id="особливості" tabindex="-1">Особливості <a class="header-anchor" href="#особливості" aria-label="Permalink to &quot;Особливості&quot;">​</a></h2><p>Основні функції Pixhawk Mini:</p><ul><li>Просунутий 32 bit ARM Cortex® M4 Processor що управляється NuttX RTOS</li><li>8 PWM/servo виводів</li><li>Кілька варіантів підключення для додаткової периферії (UART, I2C, CAN)</li><li>Резервні входи живлення та автоматичне перемикання на резервне джерело</li><li>Інтегрований перемикач безпеки та опційна зовнішня кнопка безпеки для легкої активації мотора</li><li>Мультиколірний LED індикатор</li><li>Інтегрований багатотональний п&#39;єзозвуковий індикатор</li><li>microSD-карта для довгострокового логування</li><li>Легкі у використанні конектори Micro JST</li></ul><p>Pixhawk Mini поставляється з новим <strong>модулем GPS</strong>:</p><ul><li>На основі u-blox M8N</li><li>Одночасне приймання до 3 GNSS (GPS, Galileo, GLONASS, BeiDou)</li><li>Найкраща в галузі навігаційна чутливість -167 dBm</li><li>Безпека та захист цілісності</li><li>Підтримує всі супутникові системи доповнення</li><li>Просунуте виявлення перешкод і спуфінгу</li><li>Варіативність продукту для задоволення вимог до продуктивності та вартості</li></ul><h2 id="набір-комплекту" tabindex="-1">Набір комплекту <a class="header-anchor" href="#набір-комплекту" aria-label="Permalink to &quot;Набір комплекту&quot;">​</a></h2><p><em>Pixhawk Mini</em> поставляється з наступним вмістом:</p><table><thead><tr><th>Компонент</th><th>Зображення</th></tr></thead><tbody><tr><td>Pixhawk Mini Autopilot</td><td><img src="'+t+'" alt="Pixhawk Mini"></td></tr><tr><td>Модуль GPS</td><td><img src="'+l+'" alt="Compass+GPS модуль"></td></tr><tr><td>Quad Power Distribution Board</td><td><img src="'+r+'" alt="Quad Power Distribution Board"></td></tr><tr><td>8 Channel PWM Breakout board</td><td><img src="'+e+'" alt="8 Channel PWM Breakout board"></td></tr><tr><td>кабель на 4 піна (для I2C)</td><td><img src="'+o+'" alt="кабель на 4 піна (для I2C)"></td></tr><tr><td>RC-in кабель для PPM/SBUS</td><td><img src="'+s+'" alt="RC-in кабель для PPM/SBUS"></td></tr><tr><td>6 to 6/4 ‘Y’ адаптер для GPS та додаткових пристроїв I2C</td><td><img src="'+n+'" alt="6 to 6/4 ‘Y’ adapter"></td></tr><tr><td>6-піновий кабель (2) (для плати розподілу живлення та для компасу/gps)</td><td><img src="'+h+'" alt="кабель на 6 пінів"></td></tr><tr><td>6-піновий JST для легасі телеметрійного радіо до DF13</td><td><img src="'+p+'" alt="6 pin JST to DF13"></td></tr><tr><td>Запобіжний перемикач</td><td><img src="'+d+'" alt="Запобіжний перемикач"></td></tr><tr><td>8 Channel PWM Breakout cable</td><td><img src="'+c+'" alt="8 Channel PWM Breakout кабель"></td></tr><tr><td>Монтажна піна</td><td><img src="'+i+'" alt="Монтажна піна"></td></tr><tr><td>I2C breakout board ? - не входить до списку запчастин у додатку</td><td>-</td></tr></tbody></table><h2 id="додаткові-аксесуари" tabindex="-1">Додаткові аксесуари <a class="header-anchor" href="#додаткові-аксесуари" aria-label="Permalink to &quot;Додаткові аксесуари&quot;">​</a></h2><ul><li>Телеметричні радіо набори: 915 МГц (США), 433 МГц (Європа) ::: info При встановленні телеметричних радіостанцій 3DR використовуйте конектори, які постачаються з Pixhawk Mini, а не ті, що постачаються з радіостанціями.</li></ul></div></div></div><ul><li>Модуль живлення 3DR 10S</li><li>WiFi Telemetry Radio</li><li>Цифровий датчик швидкості</li></ul><h2 id="сумісність" tabindex="-1">Сумісність <a class="header-anchor" href="#сумісність" aria-label="Permalink to &quot;Сумісність&quot;">​</a></h2><h3 id="rc-радіо" tabindex="-1">RC радіо <a class="header-anchor" href="#rc-радіо" aria-label="Permalink to &quot;RC радіо&quot;">​</a></h3><ul><li>PPM вивід RC приймачів</li><li>Spektrum DSM RC приймачі</li><li>Futaba S BUS RC приймачі</li></ul><h3 id="esc" tabindex="-1">ESC <a class="header-anchor" href="#esc" aria-label="Permalink to &quot;ESC&quot;">​</a></h3><ul><li>Всі стандартні ESC з PWM входом</li></ul><h2 id="призначення-пінів-конекторів-виводи-пінів" tabindex="-1">Призначення пінів конекторів (виводи пінів) <a class="header-anchor" href="#призначення-пінів-конекторів-виводи-пінів" aria-label="Permalink to &quot;Призначення пінів конекторів (виводи пінів)&quot;">​</a></h2><p><img src="'+m+'" alt="Pixhawk Mini - Connector Pinouts"></p><h2 id="порівняння-продуктів" tabindex="-1">Порівняння продуктів <a class="header-anchor" href="#порівняння-продуктів" aria-label="Permalink to &quot;Порівняння продуктів&quot;">​</a></h2><h3 id="pixhawk-mini-та-pixhawk-оригінальнии" tabindex="-1">Pixhawk Mini та Pixhawk (оригінальний) <a class="header-anchor" href="#pixhawk-mini-та-pixhawk-оригінальнии" aria-label="Permalink to &quot;Pixhawk Mini та Pixhawk (оригінальний)&quot;">​</a></h3><ul><li>Одна третя розміру - від 50х81.5х15.5мм до 38x43х12мм.</li><li>Процесор Rev 3 для повного використання 2 МБ флеш-пам&#39;яті.</li><li>Покращені датчики, як основний, так і додатковий IMU MPU9250 та ICM20608 відповідно. Результат - це більш стабільний, більш надійний політ і навігація.</li><li>Модуль GPS+Компас включено. Містить Neo M8N з підтримкою GLONASS; компас HMC5983. Очікуйте швидшого та сильнішого захоплення GPS.</li><li>Мікро JST конектори замість DF-13. З ними набагато простіше працювати.</li><li>Інтегрований п&#39;єзозвуковий динамік та запобіжний перемикач.</li><li>Підтримує 4S акумулятори нативно за допомогою включеної плати розподільників потужності (PDB).</li></ul><h3 id="pixhawk-mini-та-pixfalcon" tabindex="-1">Pixhawk Mini та Pixfalcon <a class="header-anchor" href="#pixhawk-mini-та-pixfalcon" aria-label="Permalink to &quot;Pixhawk Mini та Pixfalcon&quot;">​</a></h3><ul><li>Покращені датчики, як основний, так і додатковий IMU MPU9250 та ICM20608 відповідно. Очікуйте кращої обробки вібрацій та надійності.</li><li>Інтерфейс CAN для підтримки UAVCAN.</li><li>Включає 8-канальний вивід сервоприводу для літаків та інших апаратів, яким потрібен заживлений PWM вивід.</li><li>Включає плату розгалуження I2C для загальної кількості 5 з&#39;єднань I2C.</li><li>Аналогічний розмір.</li></ul><p>Pixhawk Mini має вдосконалений процесор та сенсорну технологію від ST Microelectronics® та операційну систему реального часу NuttX, що забезпечує відмінну продуктивність, гнучкість та надійність для керування будь-яким безпілотним транспортним засобом.</p><h2 id="відомі-проблеми" tabindex="-1">Відомі проблеми <a class="header-anchor" href="#відомі-проблеми" aria-label="Permalink to &quot;Відомі проблеми&quot;">​</a></h2><ul><li>Деякі Pixhawk Mini мають <a href="https://github.com/PX4/PX4-Autopilot/issues/7327#issuecomment-317132917" target="_blank" rel="noreferrer">дефект апаратного забезпечення</a>, який робить внутрішній IMU MPU9250 ненадійним. <ul><li>Проблема присутня лише в старіших версіях апаратного забезпечення, оскільки <a href="https://github.com/PX4/PX4-Autopilot/issues/7327#issuecomment-372393609" target="_blank" rel="noreferrer">вона була виправлена якимось чином виробником</a>.</li><li>Щоб перевірити, чи певна плата постраждала чи ні, залиште плату відключеною на деякий час, потім увімкніть її та спробуйте запустити драйвер mpu9250 з командного рядка PX4. Якщо плата пошкоджена, драйвер не запуститься.</li><li>MPU9250 <a href="https://github.com/PX4/PX4-Autopilot/pull/7618" target="_blank" rel="noreferrer">за замовчуванням вимкнено</a> у вбудованому програмному забезпеченні PX4.</li><li>Дефектні Pixhawk Mini не будуть калібруватися без зовнішнього магнітометра або підключеного GPS, навіть у приміщенні.</li><li>При використанні зовнішнього GPS, <a href="https://github.com/PX4/PX4-Autopilot/pull/7618#issuecomment-320270082" target="_blank" rel="noreferrer">це не проблема</a>, оскільки вторинний ICM20608 надає акселерометр та гіроскоп, тоді як зовнішній GPS надає магнітометр.</li></ul></li></ul><p><a id="wiring"></a></p><h2 id="посібник-зі-швидкого-запуску-підключення" tabindex="-1">Посібник зі швидкого запуску підключення <a class="header-anchor" href="#посібник-зі-швидкого-запуску-підключення" aria-label="Permalink to &quot;Посібник зі швидкого запуску підключення&quot;">​</a></h2><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p><em>Pixhawk Mini</em> більше не виробляється або не доступний від 3DR. :::</p><p>Цей швидкий старт показує, як живити польовий контролер <a href="./../flight_controller/pixhawk_mini.html">Pixhawk Mini</a> та підключити його найважливіші периферійні пристрої.</p><h3 id="стандартна-схема-проводки" tabindex="-1">Стандартна схема проводки <a class="header-anchor" href="#стандартна-схема-проводки" aria-label="Permalink to &quot;Стандартна схема проводки&quot;">​</a></h3><p>Нижче показана стандартна замовлення <em>квадрокоптер</em> використовуючи <em>Набір Pixhawk Mini</em> та 3DR Телеметрія Радіо (разом з ESC, мотором, батареєю та станцією керування на землі, яка працює на телефоні). Ми розглянемо кожен основний елемент в наступних розділах.</p><p><img src="'+u+'" alt="Pixhawk Mini Electronics Wiring for QAV250 (off frame)"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Вивід проводки / живлення трохи відрізняється для інших типів транспортних засобів. Це докладніше описано нижче для VTOL, Plane, Copter.</p></div></div><h3 id="монтаж-та-орієнтація-контролера" tabindex="-1">Монтаж та орієнтація контролера <a class="header-anchor" href="#монтаж-та-орієнтація-контролера" aria-label="Permalink to &quot;Монтаж та орієнтація контролера&quot;">​</a></h3><p><em>Pixhawk Mini</em> слід встановити на раму за допомогою віброгасильні поролонові накладки (входять в комплект). Вона повинна бути розташувати якомога ближче до центру тяжіння вашого автомобіля верхньою стороною вгору зі стрілкою в напрямку передньої частини автомобіля.</p><p><img src="'+P+'" alt="Рекомендована орієнтація Pixhawk Mini"></p><p><img src="'+i+'" alt="Монтажна піна"></p><div class="info custom-block"><p class="custom-block-title">Якщо контролер не може бути змонтований в рекомендованій/стандартній орієнтації (наприклад, через обмеження місця), вам потрібно буде налаштувати програмне забезпечення автопілота з орієнтацією, яку ви фактично використовували: <a href="./../config/flight_controller_orientation.html">Орієнтація контролера польоту</a>. :::</p><h3 id="gps-компас" tabindex="-1">GPS + Компас <a class="header-anchor" href="#gps-компас" aria-label="Permalink to &quot;GPS + Компас&quot;">​</a></h3><p>Під’єднайте 3DR GPS + Compass до порту <strong>GPS&amp;I2C</strong> Pixhawk Mini (угорі праворуч) за допомогою 6-контактного кабелю, що входить у комплект. GPS/компас слід монтувати на раму якомога подалі від інших електронних пристроїв, з напрямком вперед транспортного засобу (відокремлення компаса від інших електронних пристроїв зменшить втручання).</p><p><img src="'+k+'" alt="Підключення компасу / GPS до Pixhawk Mini"></p><p>NOTE - INSERT IMAGE SHOWING BOTH PORTS? OR FRONT-FACING image of GPS&amp;I2C</p><p>Компас повинен бути калібрований перед першим використанням: <a href="./../config/compass.html">Калібрування компасу</a></p><h3 id="живлення" tabindex="-1">Живлення <a class="header-anchor" href="#живлення" aria-label="Permalink to &quot;Живлення&quot;">​</a></h3><p>На зображенні нижче показано типове підключення живлення при використанні <em>Pixhawk Mini</em> у квадрокоптері. Для цього використовується <em>четвірна плата розподілу живлення</em>, яка постачається в комплекті, щоб живити Pixhawk Mini і ESC/Motor від батареї (а також може живити інші аксесуари).</p><div class="info custom-block"><p class="custom-block-title">До <em>Плата розподілу потужності Quad</em> входить модуль живлення (PM), який підходить для акумуляторів &lt;= 4S. Рекомендовано використовувати модуль живлення <em>3DR 10S Power</em> (Скасовано), якщо вам потрібно більше потужності. :::</p><p><img src="'+g+'" alt="Pixhawk Mini - живлення"></p><p><em>Pixhawk Mini</em> живиться через порт <strong>PM</strong>. При використанні модуля живлення (як у цьому випадку) порт також буде читати аналогові вимірювання напруги та струму.</p><p>До 4 ESC можна живити окремо від розподільного щита (хоча в цьому випадку підключено лише один).</p><p>Сигнали керування надходять з MAIN OUT. У цьому випадку є лише один керуючий канал, який підключений до ESC через <em>8 канальну плату розбору PWM</em>.</p><p>Шина виводу Pixhawk Mini (MAIN OUT) не може живити підключені пристрої (і не потребує цього в схемі, як показано). Для транспортних засобів, де MAIN OUT підключений до пристроїв, які споживають енергію (наприклад, сервопривід, використовуваний у літаку), вам потрібно буде живити рейку за допомогою BEC (елімінаційна схема батареї). Включена плата розподільчого модуля дозволяє одному каналу надавати живлення на інші виходи.</p><h3 id="радіоуправління" tabindex="-1">Радіоуправління <a class="header-anchor" href="#радіоуправління" aria-label="Permalink to &quot;Радіоуправління&quot;">​</a></h3><p>Pixhawk Mini підтримує багато різних моделей радіоприймачів:</p><ul><li><p>Приймачі Spektrum і DSM підключаються до входу <strong>SPKT/DSM</strong>.</p><img src="'+b+'" width="350px" title="Pixhawk Mini - порт радіопередавача для приймачів Spektrum"></li><li><p>Приймачі PPM-SUM та S.BUS підключаються до порту <strong>RCIN</strong>.</p><img src="'+x+'" width="350px" title="Pixhawk Mini - радіопорт для PPM приймачів"></li><li><p>Приймачі PPM та PWM, які мають <em>окремий провід для кожного каналу</em>, повинні підключатися до порту <strong>RCIN</strong> <em>через PPM кодер</em> <a href="http://www.getfpv.com/radios/radio-accessories/holybro-ppm-encoder-module.html" target="_blank" rel="noreferrer">як цей</a> (приймачі PPM-Sum використовують один сигнальний провід для всіх каналів).</p></li></ul><p>Для отримання додаткової інформації про вибір радіосистеми, сумісність приймача та зв&#39;язок вашої передавача/приймача, див. статтю: <a href="./../getting_started/rc_transmitter_receiver.html">Пульт керування передавачів&amp; приймачів</a>.</p><h3 id="запобіжнии-перемикач-опціино" tabindex="-1">Запобіжний перемикач (опційно) <a class="header-anchor" href="#запобіжнии-перемикач-опціино" aria-label="Permalink to &quot;Запобіжний перемикач (опційно)&quot;">​</a></h3><p>Контролер має вбудований безпечний перемикач, який ви можете використовувати для активації двигуна, як тільки автопілот готовий злетіти. Якщо на певному транспортному засобі важкодоступний до цього перемикача, ви можете прикріпити (необов’язкову) зовнішню кнопку безпеки, як показано нижче.</p><p><img src="'+_+'" alt="Pixhawk Mini - опціональний перемикач"></p><h3 id="телеметричні-радіопередавачі" tabindex="-1">Телеметричні радіопередавачі <a class="header-anchor" href="#телеметричні-радіопередавачі" aria-label="Permalink to &quot;Телеметричні радіопередавачі&quot;">​</a></h3><h3 id="мотори" tabindex="-1">Мотори <a class="header-anchor" href="#мотори" aria-label="Permalink to &quot;Мотори&quot;">​</a></h3><p>Відображення між головними/допоміжними вихідними портами та двигунами/сервоприводами для всіх підтримуваних повітряних та наземних конструкцій перераховані в <a href="./../airframes/airframe_reference.html">Довіднику з повітряних конструкцій</a>.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Відображення не є однорідним для всіх конструкцій (наприклад, ви не можете покладатися на те, що ручка газу буде на тому ж вихідному порту для всіх повітряних конструкцій). Переконайтеся, що ви використовуєте правильне зіставлення для вашого апарату.</p></div></div></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Якщо ваша рама не вказана в довіднику, використовуйте &quot;загальний&quot; планер коректного типу. ::: infos:</p><ul><li>Вихідна шина повинна мати окреме живлення, як описано в розділі <a href="#power">Живлення</a> вище.</li><li>Pixhawk Mini не може бути використаний для каркасів QuadPlane VTOL. Це через те, що QuadPlane потребує 9 виводів (4 основних, 5 додаткових) і Pixhawk Mini має лише 8 виводів (8 основних).</li></ul><img src="'+f+'" width="350px" title="Pixhawk Mini - порт для моторів/серво"><h3 id="інші-периферіині-пристроі" tabindex="-1">Інші периферійні пристрої <a class="header-anchor" href="#інші-периферіині-пристроі" aria-label="Permalink to &quot;Інші периферійні пристрої&quot;">​</a></h3><p>Підключення та конфігурація інших компонентів описано в темах для окремих <a href="./../peripherals/">периферійних пристроїв</a>.</p><h3 id="конфігурація" tabindex="-1">Конфігурація <a class="header-anchor" href="#конфігурація" aria-label="Permalink to &quot;Конфігурація&quot;">​</a></h3><p>Загальна інформація про конфігурацію описана в: <a href="./../config/">Конфігурація автопілота</a>.</p><p>Конфігурація для QuadPlane описана тут: <a href="./../config_vtol/vtol_quad_configuration.html">Конфігурація QuadPlane VTOL</a></p><h2 id="збірка-прошивки" tabindex="-1">Збірка прошивки <a class="header-anchor" href="#збірка-прошивки" aria-label="Permalink to &quot;Збірка прошивки&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Більшості користувачів не потрібно збирати цю прошивку! Вона попередньо зібрана й автоматично встановлюється за допомогою <em>QGroundControl</em> при підключенні відповідного апаратного забезпечення. :::</p><p>Щоб <a href="./../dev_setup/building_px4.html">зібрати PX4</a> для цієї цілі:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make px4_fmu-v3_default</span></span></code></pre></div><h2 id="відладочнии-порт" tabindex="-1">Відладочний порт <a class="header-anchor" href="#відладочнии-порт" aria-label="Permalink to &quot;Відладочний порт&quot;">​</a></h2><p>Ця плата не має роз&#39;єму для налагодження (тобто вона не має роз&#39;єму для доступу до <a href="./../debug/system_console.html">Системної консолі</a> або <a href="./../debug/swd_debug.html">інтерфейсу SWD</a>).</p><p>Розробники повинні будуть припаяти дроти до підключених площин для SWD, а також до STM32F4 (IC) TX і RX, щоб отримати консоль.</p></div></div>',27),I=[v];function R(T,N,G,A,D,X){return w(),S("div",null,I)}const W=M(C,[["render",R]]);export{y as __pageData,W as default};
